    false,nt"url": null,nt"notes": "These data sets are ORGANON input files
    and SAS permanent data files prepared for data on study plots on five BLM Districts
    in western Oregon. Data was collected from 1993-1995 primarily on BLM lands to compare
    past thinnings (10-25 years old) to immediately adjacent unthinned stands and nearby
    old-growth where available. Data is focused on overstory trees, saplings, seedlings,
    shrubs and herbaceous plant cover in the various stand types.",nt"license_title":
